                font-style: normal;
                text-align: center;
                font-size: 4em;
                text-align: center;
                width: 100%;
                margin: 0 10px 5px 0px;
                display: inline-block;
                color: #E6E6E6;
            }

            @media ${device.tablet} {

            }
        `}
        </style>
    </header>
)

export default Header
